warnings.filterwarnings("ignore", category=UserWarning)

# 1. Data Loading
FILE_PATH = os.path.join(os.getcwd(), 'D:\work_software\PyCharmWork\HNTCV\Concrete-Image-Classification-main\our_dataset\condef')

# 2. Data Preparation
BATCH_SIZE = 16

# Define data transformations
val_test_transforms = transforms.Compose([
    # transforms.Resize((299, 299)),
    transforms.ToTensor(),
    transforms.Normalize(mean=[0.485, 0.456, 0.406], std=[0.229, 0.224, 0.225]),
])

# Load datasets
val_dataset = datasets.ImageFolder(os.path.join(FILE_PATH, 'test'), transform=val_test_transforms)

# Create dataloader
val_loader = torch.utils.data.DataLoader(val_dataset, batch_size=BATCH_SIZE, shuffle=False, num_workers=4)

# Load the trained model
# model = models.mobilenet_v2(pretrained=False)  # Do not load the pretrained weights this time
model = models.mobilenet_v2(pretrained=False)  # Do not load the pretrained weights this time
model_name = 'mobilenet_v2'
if model_name == "inception_v3":
    model.aux_logits = False  
if model_name == "VGG19":
    # VGG19
    model.classifier[6] = torch.nn.Linear(model.classifier[6].in_features, len(val_dataset.classes))
elif model_name in ["resnet50", "inception_v3"]:
    # resnet50 inception_v3
    model.fc = torch.nn.Linear(model.fc.in_features, len(val_dataset.classes))
else:
    model.classifier[1] = torch.nn.Linear(model.classifier[1].in_features, len(val_dataset.classes))

model.load_state_dict(torch.load(os.path.join(os.getcwd(), 'saved_model', 'saved_models.pth')))
model.eval()

# Setup device
device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
model = model.to(device)

# Evaluate the model
def evaluate_model(model, val_loader, total_text_preds):
    all_preds = []
    all_labels = []
    all_scores = []  # Save the probability of prediction
    with torch.no_grad():
        for (inputs, labels), text_pred_batch in zip(tqdm(val_loader, desc="Evaluating", unit="batch"), total_text_preds):
            inputs, labels = inputs.to(device), labels.to(device)
            outputs = model(inputs)
            _, predicted = torch.max(outputs, 1)
            # all_preds.extend(predicted.cpu().numpy())
            all_labels.extend(labels.cpu().numpy())
            # Probability of each label
            probabilities = F.softmax(outputs, dim=1)
            # Fusion Layer
            for prob, text_pred in zip(probabilities, text_pred_batch):
                # print(prob, text_pred)
                if text_pred != "-1":
                    # prob[text_pred] = prob[text_pred]
                    prob[text_pred] = prob[text_pred] * 2.5
                # print(prob, text_pred)

            all_scores.extend(probabilities.cpu().numpy())
            predicted_labels = torch.argmax(probabilities, dim=1)
            all_preds.extend(predicted_labels.tolist())
            # print(probabilities.cpu().numpy())
    # Compute and print the evaluation metrics
    # print("Confusion Matrix:\n", confusion_matrix(all_labels, all_preds, labels=np.unique(all_labels)))
    class_report = classification_report(all_labels, all_preds, output_dict=True)
    print("--------------------------Visual modality prediction results------------------------------")
    print(all_preds)

    print("Classification Report:")
    for label, metrics in class_report.items():
        if label != 'accuracy':  # skip the accuracy row in the report
            print(
                f"Class {label}: precision = {metrics['precision']:.4f}, recall = {metrics['recall']:.4f}, f1-score = {metrics['f1-score']:.4f}")

    accuracy = accuracy_score(all_labels, all_preds)
    print(f"Accuracy Score: {accuracy:.5f}")  # format to 5 decimal places


def text_classifier(val_loader, all_prompts, all_label, oss_path_root):
    total_text_preds = []
    results = []  # Save all visual prediction information
    # for epoch in range(epochs):
    json_file_path = f"description_output/description_qwen_vl_max.json"
    for images, labels in tqdm(val_loader, desc="Evaluating", unit="batch"):
        text_pred_batch = []
        # # Retrieve the index from the batch
        # batch_indices = train_loader.dataset.samples  # Get (path, label)
        # Find the corresponding path through labels
        # image_paths = [item for item in val_loader.dataset.samples]
        image_paths= []
        for i in range(len(labels)):
            path, label = val_loader.dataset.samples.pop(0)  # Extract and delete the first element
            image_paths.append(path)  # Storage Path

        # Upload Aliyun OSS
        for i in range(len(image_paths)):
            label_str = str(labels[i].item())
            print(f"Path: {image_paths[i]}, Label: {label_str}")
            filename = label_str + "_" + image_paths[i][image_paths[i].rfind("\\") + 1:]
            aliyun_oss.oss_upload(image_paths[i], filename)
            # Your Alibaba Cloud OSS storage path
            # oss_path = "https://hntcv.oss-cn-beijing.aliyuncs.com/HNT_IMG/" + filename
            oss_path = oss_path_root + filename

            # Call LLM parsing to obtain image description
            img_description = qwen_vl_max.call_with_messages(oss_path, 0.1, 50, 0.1)
            print(img_description)
            results.append({
                "oss_path": oss_path,
                "label": label_str,
                "description": img_description
            })
            # Add write to JSON Lines file, if you want to run text mode, please untangle the comment on that line
            # with open(json_file_path, "a", encoding="utf-8") as f:
            #     json.dump({
            #         "oss_path": oss_path,
            #         "label": label_str,
            #         "description": img_description
            #     }, f, ensure_ascii=False)
            #     f.write("\n")

            # Compressor classification
            pred, correct = mmc(img_description, label_str, all_prompts, all_label)
            # text_pred_batch.append(pred if correct else '-1')
            text_pred_batch.append(pred)
        total_text_preds.append(text_pred_batch)
    print("---------------------Text modal prediction results-------------------")
    print(total_text_preds)

    # Write results to a JSON file
    with open("our_dataset/oss_results_condef.json", "w", encoding="utf-8") as f:
        json.dump(results, f, ensure_ascii=False, indent=4)

    return total_text_preds


